INSERT INTO `tl_article` VALUES ( 61, 60, 128, 1505492979, 'Is Macron the next Trump', 'is-macron-the-next-trump', 1, 'main', NULL, '1', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '<p>Who is Frances new president and where did he come from? Why did the French people decide on such a person and what will he bring to France? In this article we compare him to President Donald Trump of the USA. Although the two make not look like it, they are very similar as head of states.[nbsp]</p>\n<p>[nbsp]</p>\n<p><img src="files/Content/Galleries/Articles/MacronTrump/Macron.png" alt="" width="942" height="470"></p>\n<p>[nbsp]</p>', '', '', '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '' );
INSERT INTO `tl_article` VALUES ( 64, 63, 128, 1505648181, 'I am my Facebook and it is me', 'i-am-my-facebook-and-it-is-me', 4, 'main', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '<p>Facebook is used on a massive scale everyday. Creating terrabytes of internet traffic and filling enormous databases with all your personal details. What are the effects of this massive social experiment and what is Facebook really doing with our data?[nbsp]</p>\n<p>[nbsp]</p>\n<p><img src="{{file::d10b1120-9a1e-11e7-a1b2-7017236cb443}}" alt="" width="960" height="684"></p>', '', 'mod_article_bootstrap_container', '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '' );
INSERT INTO `tl_article` VALUES ( 67, 66, 128, 1505235950, 'How Tourism changes the planet', 'how-tourism-changes-the-planet', 1, 'main', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '<p>Here we take a close look at the effects of tourism on the world. Economic development and climate change are just two things we look at it</p>', '', 'mod_article_bootstrap_container', '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '' );
