INSERT INTO `tl_content` VALUES ( 369, 7, 'tl_article', 528, 1505660710, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:19:"Teaching in Germany";}', '<p class="p1">When I was 19, I left my home of Penzance, England for Germany. It was a lot of fun and very exciting. It was my first big adventure. I got my TEFL qualification and went to work teaching at language schools in Hannover. I also worked at the university . I found it more fun giving private English lessons. I could talk about what I want and cut out the boring shit that the language schools made me teach. I later worked for Continental teaching business English as well as some other small engineering firms where I taught and translated.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:9:"col-md-12";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
