INSERT INTO `tl_content` VALUES ( 81, 48, 'tl_article', 1408, 1505327217, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:13:"Skype Lessons";}', '<p class="p1">I give face-to-face Skype lessons for individuals and groups. The lessons are 45-minutes long and cost 20 Euros per lessons. For native speaks of Spanish, German or Dutch I teach all levels, and at intermediate level for native speakers of all other languages. Together we focus on speaking, as it is most important, and through homework and working projects, we perfect grammar and written skills.[nbsp]You only need a camera, a microphone and the internet. Skype is free!</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:24:"col-md-4 col-md-offset-1";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
INSERT INTO `tl_content` VALUES ( 151, 8, 'tl_calendar_events', 32, 1505125916, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:28:"Information about the lesson";}', '<p>In this lesson, we will be discussing the following:[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
INSERT INTO `tl_content` VALUES ( 83, 28, 'tl_article', 128, 1504786826, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:27:"Awaiting Email Confirmation";}', '<p>Please check your inbox of the email address you provided for the link you need[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
INSERT INTO `tl_content` VALUES ( 84, 13, 'tl_article', 128, 1504787078, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:25:"Thankyou for your message";}', '<p>We have gotten your message and will reply soon :D[nbsp]</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
INSERT INTO `tl_content` VALUES ( 85, 7, 'tl_article', 128, 1505152326, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:10:"Hi I\'m Sam";}', '<p class="p1">Nice to see that somebody is reading about me! I’m a man from England who loves to work and travel. I work as a freelance web developer and online English teacher. My hobbies are travelling, languages and meeting different people. I like to be different and don’t really care what other people think about me. I’m currently living in the south of Spain. Sometimes I sleep on mountains next to castles, sometimes in abandoned villas and sometimes in cosy AirBNBs. I also spent 3 weeks in a stunningly beautiful hippy village smoking weed and taking LSD. I live the nomad life and hate to be normal, boring or politically correct. The world needs to change, and we should be able to say what we believe. I channel my inspiration from all my travels and crazy activities into giving fun and exciting English lessons.</p>', '', 0xf5a6132093c711e796b9018ec739c73b, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-md-6";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
