INSERT INTO `tl_content` VALUES ( 214, 64, 'tl_article', 384, 1505235454, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:25:"The power of Facebook....";}', '<p>[nbsp]</p>\n<p>Sometimes we just need to stop and ask ourselves, how did Facebook get so far? Before 2005 even, many people did not know about Facebook, yet alone have it. Now within the youngest generation. It seems like everybody has a Facebook and the trend of social media is not dying out. More and people are signing up with other social networks like Twitter, Instagram, Steam, Playstation Network and Xing.[nbsp]</p>\n<p style="padding-left: 30px;">-Do you have a Facebook account? What do you use it for?[nbsp]</p>\n<p style="padding-left: 30px;">-How often do you use your Facebook account?[nbsp]</p>\n<p>As a teenager, I grew up at a time when Facebook was becoming popular. The generation before me did not use Facebook and people only really began to use it around the ages of 14 to 15. Nowadays it seems children as young as 7 - 8 have Facebook. The amount of children with mobile phones is always increasing and with it the amount of Facebook Mobile users.[nbsp]</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>', '', 0x5d969a9e97db11e7868e0cc47adc87ce, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
