INSERT INTO `tl_content` VALUES ( 219, 64, 'tl_article', 768, 1505235514, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:20:"What about the data?";}', '<p>[nbsp]</p>\n<p>This is the most important part. The data that Facebook collects about you, the data many people simply chose to forget about. Depending on the user and how much much they use Facebook, it knows where you are in the world, it knows who your friends are, it knows your opinions about things and it knows what you say to your friends. Conversations and voice calls are recorded, images processed and facially recognised, social patterns analysed; all this by a computer running complex algorithms.</p>\n<p>[nbsp]</p>\n<ul>\n<li>[nbsp]Are you worried about what Facebook can do with all your personal information?[nbsp]</li>\n<li>[nbsp]Do you think the government has access to your information through Facebook?[nbsp]</li>\n<li>[nbsp]How do you feel about computers analysing your personal information to give you suitable adverts?[</li>\n</ul>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
